import React from 'react';
import "./styles/Item.css";
import './styles/ItemList.css';

class Item extends React.Component {
  render() {

    return (

        <div className="Item">
        <div className="row">
            <div className="col-4 Item__Circulo">

                <div className="Item__Circulo--forma"> </div>
            </div>
            <div className="col-8 Item__Info">
                <p className="Item__Name"> {this.props.item.sequence} </p>
                <p className="Item__Creado">Creado en: </p>
            </div>

            <div className="col-12 Item__Muta"> {this.props.item.mutation} </div>
        </div>

        </div>

    );
  }
}

class ItemList extends React.Component {
  render() {

    if (this.props.items.length === 0) {
      return (
        <div>
          <h3>No Items were found</h3>
        </div>
      );
    }

    return (

        <div className="demas row">
            {this.props.items.map(item => {
                return(
                    <div className="col-4">
                        <Item item={item}/>
                    </div>
                )
            })}  

        </div>
    );
  }
}

export default ItemList;
